&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Aprende a construir apilando los grandes ladrillos LEGO&reg; DUPLO&reg; para crear un divertido cohete y un planeta de colores; contiene tarjetas de construcci&oacute;n con ideas. Anima a tu hijo a desempe&ntilde;ar diferentes funciones y aprender a contar emparejando los ladrillos decorados con una luna, 2 planetas y 3 estrellas, con los ladrillos numerados correspondientes. Los ladrillos DUPLO est&aacute;n dise&ntilde;ados espec&iacute;ficamente para proporcionar seguridad en las manos de los m&aacute;s peque&ntilde;os.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Cuenta con un cohete para construir y un planeta.&lt;/li&gt;
&lt;li&gt;Incluye un ladrillo decorado a doble cara con un ni&ntilde;o/ni&ntilde;a, ladrillos decorados con la luna, 2 planetas y 3 estrellas, y ladrillos decorados con los n&uacute;meros 1, 2 y 3 para aprender y jugar.&lt;/li&gt;
&lt;li&gt;Desarrolla las habilidades de construcci&oacute;n de tu hijo invit&aacute;ndolo a apilar los ladrillos para crear un cohete y un planeta.&lt;/li&gt;
&lt;li&gt;Incluye tarjetas de construcci&oacute;n para ayudarte a combinar los ladrillos de diferentes formas, creando nuevos cohetes o edificios.&lt;/li&gt;
&lt;li&gt;&iexcl;Juega con tu beb&eacute; mientras le ense&ntilde;as a contar hasta 3!&lt;/li&gt;
&lt;li&gt;A los beb&eacute;s les encanta inventar historias basadas en el espacio exterior.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; se dise&ntilde;an espec&iacute;ficamente para proporcionar seguridad y facilitar el juego a los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;El cohete mide m&aacute;s de 23 cm de altura, 9 cm de ancho y 6 cm de profundidad.&lt;/li&gt;
&lt;li&gt;Edad: 1&frac12; - 5&lt;/li&gt;
&lt;li&gt;Piezas: 18&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

